import React from 'react';
import Lobby from './Lobby';

class Switch extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
		}
		this.chooseRoute = this.chooseRoute.bind(this);
	}
	componentDidMount() {
		console.log('alalal');
		console.log(document.URL.split(/\//));
		// this.state.children[0].props.children
	}
	chooseRoute() {
		switch(document.URL.split(/\//)[3]) {
			case 'connexion':
				return <p>Connexion</p>;
				break;
			case 'lobby':
				return <Lobby/>;
				break;
			default:
				return <p>Home</p>;
				break
		}
	}
	render() {
		return (
			<div>
              { this.chooseRoute() }
			</div>
		)
	}
}

class Router extends React.Component {
  render() {
    return(
      <Switch/>
	)
  }
}

export default Router;
